def run(inputs, env):
    """
    Latest EMA(period) of close.
    Params: symbol, timeframe, period (int), lookback (optional)
    """
    # params
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    p_raw = inputs.get("period", 20)
    try: period = int(p_raw)
    except Exception: period = 20
    lb = inputs.get("lookback", max(3*period, 200))
    try: lb = int(lb)
    except Exception: lb = max(3*period, 200)

    # candles (test override or fetch)
    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client")
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    closes = []
    for c in (candles or [])[-lb:]:
        cl = c.get("close", c.get("c"))
        if cl is None: continue
        closes.append(float(cl))
    if len(closes) < period + 1:
        raise ValueError("Not enough candles for EMA.")

    k = 2.0 / (period + 1.0)
    ema = closes[0]
    for v in closes[1:]:
        ema = v * k + ema * (1.0 - k)
    return round(ema, 6)

