def run(inputs, env):
    """
    Latest RSI(period) using Wilder's smoothing.
    """
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    p_raw = inputs.get("period", 14)
    try: period = int(p_raw)
    except Exception: period = 14
    lb = inputs.get("lookback", max(period + 100, 200))
    try: lb = int(lb)
    except Exception: lb = max(period + 100, 200)

    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client")
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    closes = []
    for c in (candles or [])[-lb:]:
        cl = c.get("close", c.get("c"))
        if cl is None: continue
        closes.append(float(cl))
    if len(closes) < period + 1:
        raise ValueError("Not enough candles for RSI.")

    gains = []
    losses = []
    for i in range(1, len(closes)):
        ch = closes[i] - closes[i-1]
        gains.append(ch if ch > 0 else 0.0)
        losses.append(-ch if ch < 0 else 0.0)

    # initial averages
    if len(gains) < period:
        raise ValueError("Not enough changes for RSI.")
    avg_gain = sum(gains[:period]) / float(period)
    avg_loss = sum(losses[:period]) / float(period)

    for i in range(period, len(gains)):
        avg_gain = (avg_gain * (period - 1) + gains[i]) / float(period)
        avg_loss = (avg_loss * (period - 1) + losses[i]) / float(period)

    if avg_loss == 0:
        return 100.0
    rs = avg_gain / avg_loss
    rsi = 100.0 - (100.0 / (1.0 + rs))
    return round(rsi, 6)

def run(inputs, env):
    """
    ROC % over 'period' bars. (close_t - close_{t-n})/close_{t-n} * 100
    """
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    p   = int(inputs.get("period", 10))
    lb  = int(inputs.get("lookback", max(p + 5, 50)))

    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client"); 
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    closes = [float(c.get("close", c.get("c"))) for c in candles if c.get("close", c.get("c")) is not None]
    if len(closes) <= p:
        raise ValueError("Not enough candles for ROC.")
    prev = closes[-1 - p]
    if prev == 0.0: return 0.0
    return round((closes[-1] - prev) / prev * 100.0, 6)

