def run(inputs, env):
    """
    Stochastic %K. period default 14.
    %K = 100 * (close - lowest_low_n) / (highest_high_n - lowest_low_n)
    """
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    p   = int(inputs.get("period", 14))
    lb  = int(inputs.get("lookback", max(p + 10, 60)))

    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client"); 
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    highs, lows, closes = [], [], []
    for c in candles[-lb:]:
        h = c.get("high", c.get("h")); l = c.get("low", c.get("l")); cl = c.get("close", c.get("c"))
        if h is None or l is None or cl is None: continue
        highs.append(float(h)); lows.append(float(l)); closes.append(float(cl))
    if len(closes) < p: raise ValueError("Not enough candles for Stochastic %K.")

    window_h = highs[-p:]; window_l = lows[-p:]
    hh = window_h[0]; ll = window_l[0]
    for v in window_h[1:]:
        hh = v if v > hh else hh
    for v in window_l[1:]:
        ll = v if v < ll else ll
    den = (hh - ll)
    if den == 0.0: return 0.0
    return round(100.0 * (closes[-1] - ll) / den, 6)

def run(inputs, env):
    """
    OBV cumulative. Adds volume if close>prev_close, subtracts if close<prev_close.
    """
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    lb  = int(inputs.get("lookback", 200))

    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client"); 
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    obv = 0.0
    prev_close = None
    for c in candles[-lb:]:
        cl = c.get("close", c.get("c")); v = c.get("volume", c.get("v"))
        if cl is None or v is None: continue
        cl = float(cl); v = float(v)
        if prev_close is None:
            prev_close = cl
            continue
        if cl > prev_close:
            obv += v
        elif cl < prev_close:
            obv -= v
        # else unchanged
        prev_close = cl
    return round(obv, 6)

def run(inputs, env):
    """
    MFI (0..100). period default 14.
    Uses typical price * volume, positive if TP>prev TP else negative.
    """
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    p   = int(inputs.get("period", 14))
    lb  = int(inputs.get("lookback", max(p + 50, 120)))

    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client"); 
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    tp, vols = [], []
    for c in candles[-lb:]:
        h = c.get("high", c.get("h")); l = c.get("low", c.get("l")); cl = c.get("close", c.get("c")); v = c.get("volume", c.get("v"))
        if h is None or l is None or cl is None or v is None: continue
        tp.append((float(h) + float(l) + float(cl))/3.0); vols.append(float(v))
    n = len(tp)
    if n < p + 1: raise ValueError("Not enough candles for MFI.")

    pos, neg = 0.0, 0.0
    for i in range(n - p, n):
        mf = tp[i] * vols[i]
        if tp[i] > tp[i-1]:
            pos += mf
        elif tp[i] < tp[i-1]:
            neg += mf
        else:
            # equal -> ignore (no add)
            pass

    if neg == 0.0:
        return 100.0
    mr = pos / neg
    mfi = 100.0 - (100.0 / (1.0 + mr))
    return round(mfi, 6)

def run(inputs, env):
    """
    Chaikin Accumulation/Distribution Line (cumulative).
    MFM = ((C-L) - (H-C)) / (H-L); MFV = MFM * Volume; AD = cumulative MFV
    """
    sym = (inputs.get("symbol") or env.get("globals", {}).get("symbol") or "NIFTY")
    tf  = (inputs.get("timeframe") or env.get("globals", {}).get("timeframe") or "5m")
    lb  = int(inputs.get("lookback", 200))

    candles = inputs.get("candles")
    if candles is None:
        client = env.get("client"); 
        if client is None: raise ValueError("No client in env.")
        candles = client.fetch_candles(sym, tf, lb)

    ad = 0.0
    for c in candles[-lb:]:
        h = c.get("high", c.get("h")); l = c.get("low", c.get("l")); cl = c.get("close", c.get("c")); v = c.get("volume", c.get("v"))
        if h is None or l is None or cl is None or v is None: continue
        h = float(h); l = float(l); cl = float(cl); v = float(v)
        rng = h - l
        if rng == 0.0:
            mfm = 0.0
        else:
            mfm = ((cl - l) - (h - cl)) / rng
        ad += mfm * v
    return round(ad, 6)

